import HeaderScreen from "./HeaderScreen";
import FooterScreen from "./FooterScreen";
import { useSelector } from "react-redux";
import MessageBox from "./messageBox";
//import { Form, Button, Col, Row, Card } from "react-bootstrap";
import Container from "@mui/material/Container";
import { ContactAction } from "../actions/ContactAction";
import { useState, useEffect } from "react";
import { useDispatch } from "react-redux";
import Alert from "@mui/material/Alert";
import Grid from "@mui/material/Grid";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";

export default function Contact2() {
  const dispatch = useDispatch();
  const contactDetails = useSelector((state) => state.contactSubmit);
  const { contactInfo, loading } = contactDetails;
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [phone, setPhone] = useState("");
  const [message, setMessage] = useState("");
  const [emailError, setEmailError] = useState("");
  const [nameError, setNameError] = useState("");
  const [phoneError, setPhoneError] = useState("");
  const [verified, setVerified] = useState(false);

  function mobileValidation(value) {
    const re = /^[0-9\b]+$/;

    if (value.length === 10) {
      if ((value === "") | re.test(value)) {
        setPhoneError("");
        setPhone(value);
      }
    } else {
      if ((value === "") | re.test(value)) {
        setPhone(value);
        setPhoneError("Invalid mobile input!");
      }
    }
  }
  const submitContact = (e) => {
   alert("button")
  };

  useEffect(() => {
    window.scrollTo(0, 0);

    if (loading) {
    } else if (contactInfo != null) {
      if (contactInfo.response_code == 1) {
        setName("");
        setEmail("");
        setPhone("");
        setMessage("");
      }
    }
  }, [contactInfo]);
  //console.log("response code", contactInfo);
  return (
    <>
      <HeaderScreen />
      <section className="page-hero home is-white">
        <div className="bg"></div>
        <div className="hero-content" id="scene-wrapper--hero-wave">
          <Grid container spacing={2}>
            <Grid item xs={6}></Grid>
            <Grid
              item
              xs={4}
              style={{
                backgroundColor: "white",
                color: "black",
                borderRadius: "10px",
              }}
            >
              <h3 style={{ color: "black" }}>Contact Details</h3>
              <p style={{ color: "black" }}>
                Enter your{" "}
                <span style={{ color: "green" }}> details so that we can </span>
                contact you!
              </p>
              <br />
              <Grid item>
                <label  placeholder="Enter your full name">

                  Enter your name <span style={{ color: "red" }}>*</span>
                </label>{" "}
                <br />
                <TextField
                  id="outlined-basic"
                  style={{ width: "430px" }}
                  variant="outlined"
                />
                <br /> <br />
                <label>
                  Enter your email <span style={{ color: "red" }}>*</span>
                </label>{" "}
                <br />
                <TextField
                  id="outlined-basic"
                  style={{ width: "430px" }}
                  variant="outlined"
                />
                <br />
                <br />
                <label>
                  Enter your mobile no. <span style={{ color: "red" }}>*</span>
                </label>{" "}
                <br />
                <TextField
                  id="outlined-basic"
                  style={{ width: "430px" }}
                  variant="outlined"
                />
                <br />
                <br />
                <label>Message</label>
                <TextField
                  id="outlined-multiline-flexible"
                  style={{ width: "430px" }}
                  multiline
                  maxRows={5}
                />
                <br />
                <br />
                <center>
                  <Button
                    variant="contained"
                    onClick={(e) => submitContact(e)}
                    style={{
                      color: "white",
                      backgroundColor: "green",
                      width: "250px",
                    }}
                  >
                    Contained
                  </Button>
                </center>
                <br />
              </Grid>
              <Grid item xs={4}></Grid>
            </Grid>
          </Grid>

          <div className="col-md-6">
            <div className="hero-img" data-appear-fade-in>
              <div className="holder" style={{ maxWidth: "700px" }}>
                <img
                  src="data:image/svg+xml,%3Csvg%20xmlns='http://www.w3.org/2000/svg'%20viewBox='0%200%200%200'%3E%3C/svg%3E"
                  className="attachment-xl"
                  alt="Homepage_2x"
                  data-lazy-src="wp-content/uploads/2022/02/Homepage_2x.png"
                />
                <noscript>
                  <img
                    src="wp-content/uploads/2022/02/Homepage_2x.png"
                    className="attachment-xl"
                    alt="Homepage_2x"
                  />
                </noscript>
              </div>
            </div>
          </div>
        </div>
      </section>
      <FooterScreen />
    </>
  );
}
